    return(
        <Card
        key= {Data[3, 4].id}
        imgsrc={Data[3, 4].imgsrc}
        sname={Data[3, 4].sname}
        title={Data[3, 4].title}
        link={Data[3, 4].link}
        />
      )
}

export default Amazon;
